for (var k = 0; k < news.length; k++) {
    var outlet = news[k]
    var border = outline[k]
    var agency = names[k]
    var imageP = imageCounts[k]
    var articlesPQ = articleCountsUnique[k]
    over(outlet)
    inf(outlet, border, agency, imageP, articlesPQ)
}
function over(news) {
    if (news == '.fox' || news == '.nbc') {
        $("circle" + news).hover(function () {
            $("circle" + news).css('cursor', 'pointer');
        }, function () {
        })
    } else {
        $("ellipse" + news).hover(function () {
            $("ellipse" + news).css('cursor', 'pointer');
        }, function () {
        })
    }
}
function inf(outlet, border, agency, img, artcl) {
    var posX = border.getBBox().x
    var posY = border.getBBox().y
    var state = 1;
    $(outlet).click(function () {
        state++;
        $(outlet).velocity({ translateX: -posX + 'px', translateY: -posY + 'px', }, { duration: 'normal' });
        for (var k = 0; k < news.length; k++) {
            if (news[k] != outlet) {
                $(news[k]).velocity({ opacity: 0 }, { visibility: 'hidden' });

            }
        }
        var l = logos.getBoundingClientRect().left;
        var t = logos.getBoundingClientRect().top;
        var h = border.getBBox().height;

        $('.news').velocity("fadeIn", { delay: 300, duration: 300 });
        $('.news').css({
            'top': (screen.height * (29.29 + h + 55) / 720) + 'px',
            'left': (screen.width * (l + 40) / 1280) + 'px',
            'padding-left': '1%',
            'padding-right': '1%',
            'opacity': '0',
        });
        document.getElementById('outlet').innerHTML = agency;
        document.getElementById('analysis').innerHTML = "In the time period of June 2015 to June 2017, " + agency + " used " + img + " AP photos featuring Syrian refugees in " + artcl + " articles, and " + agency + " accounted for " + Math.round(artcl / 650 * 100) + "% of articles";
        if (outlet != '.wsj') {
            document.getElementById('analysis').innerHTML += '; The following is a word cloud of the most frequent words in ' + agency + " articles:"
            document.getElementById('wordCloud').setAttribute('src', 'wordCloudImages/' + outlet.replace(/\./g, '') + ".png")
            $("#wordCloud").css({
                "display": "block"
            });
        } else {
            document.getElementById('wordCloud').setAttribute('src', '');
            document.getElementById('analysis').innerHTML += '. Due to lack of data, no analysis was conducted on The Wall Street Journal Articles.'
            $("#wordCloud").css({
                "display": "none"
            });
        }
        $('.close').click(function () {
            console.log(state)
            if (state > 0) {
                state = 0;
                undo(outlet, border);
            }
            $('.news').css({
                'top': -9999 + 'px',
                'left': -9999 + 'px',
                'padding-left': '1%',
                'padding-right': '1%',
            });
        });
    });

}
function hide(news) {
    for (var k = 0; k < news.length; k++) {
        var outlet = news[k];
        if (outlet != news) {
            $(outlet).velocity({ opacity: 0 }, { visibility: 'hidden' });
        }
    }
}
function undo(outlet, border) {
    var posX = border.getBBox().x
    var posY = border.getBBox().y
    $(outlet).velocity({ translateX: 0 + 'px', translateY: 0 + 'px' }, { duration: 'normal' });
    for (var k = 0; k < news.length; k++) {
        if (news[k] != outlet) {
            $(news[k]).velocity({ opacity: 1 }, { visibility: 'visible' });
        }
    }
}
